import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Card,
  Form,
  Input,
  Button,
  Typography,
  Space,
  message
} from 'antd';
import {
  LockOutlined,
  SafetyCertificateOutlined
} from '@ant-design/icons';
import { useAuth } from '../contexts/AuthContext';

const { Title, Text } = Typography;

const Login = () => {
  const [form] = Form.useForm();
  const [loading, setLoading] = useState(false);
  const { login } = useAuth();
  const navigate = useNavigate();

  const handleSubmit = async (values) => {
    setLoading(true);

    try {
      console.log('üîë Â∞ùËØïÁôªÂΩï:', values.password);

      // ÂÖàÂ∞ùËØïÁúüÂÆûÁöÑAPIÁôªÂΩï
      const result = await login(values.password);

      if (result.success) {
        console.log('‚úÖ ÁôªÂΩïÊàêÂäüÔºåË∑≥ËΩ¨Âà∞‰ª™Ë°®Êùø');
        navigate('/admin/dashboard');
      } else {
        console.log('‚ùå ÁôªÂΩïÂ§±Ë¥•:', result.message);

        // Â¶ÇÊûúÊòØÁΩëÁªúËøûÊé•ÈîôËØØÔºåÊèê‰æõ‰∏¥Êó∂ÁöÑÊ®°ÊãüÁôªÂΩï
        if (result.message && result.message.includes('ÁΩëÁªú')) {
          console.log('üö® Ê£ÄÊµãÂà∞ÁΩëÁªúÈóÆÈ¢òÔºåÊèê‰æõ‰∏¥Êó∂Ê®°ÊãüÁôªÂΩï');

          // ‰∏¥Êó∂Ê®°ÊãüÁôªÂΩïÂäüËÉΩ
          if (values.password === 'admin123' || values.password === 'health2024' || values.password === 'manager888') {
            const mockToken = 'mock_admin_token_' + Date.now();
            const mockPermissions = ['viewUserData', 'viewSensitiveInfo', 'exportData', 'freezeUser'];

            localStorage.setItem('admin_token', mockToken);
            localStorage.setItem('admin_permissions', JSON.stringify(mockPermissions));
            localStorage.setItem('admin_expire_time', new Date(Date.now() + 30 * 60 * 1000).toISOString());

            message.warning('‰ΩøÁî®‰∏¥Êó∂Ê®°ÊãüÁôªÂΩïÔºàÂêéÁ´ØÊúçÂä°Âô®Êú™ËøûÊé•Ôºâ');
            navigate('/admin/dashboard');
            return;
          }
        }
      }
    } catch (error) {
      console.error('ÁôªÂΩïÂºÇÂ∏∏:', error);
      message.error('ÁôªÂΩïËøáÁ®ã‰∏≠Âá∫Áé∞ÂºÇÂ∏∏');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      padding: '20px'
    }}>
      <Card
        style={{
          width: '400px',
          boxShadow: '0 4px 12px rgba(0, 0, 0, 0.15)',
          borderRadius: '12px'
        }}
        bodyStyle={{ padding: '40px' }}
      >
        <Space direction="vertical" size="large" style={{ width: '100%' }}>
          {/* Ê†áÈ¢òÂå∫Âüü */}
          <div style={{ textAlign: 'center' }}>
            <SafetyCertificateOutlined 
              style={{ 
                fontSize: '48px', 
                color: '#1890ff',
                marginBottom: '16px'
              }} 
            />
            <Title level={2} style={{ margin: 0, color: '#262626' }}>
              ÂÅ•Â∫∑ÂÆàÊä§ÁÆ°ÁêÜÂêéÂè∞
            </Title>
            <Text type="secondary">
              Ë∂ÖÁ∫ßÁÆ°ÁêÜÂëòÁôªÂΩï
            </Text>
          </div>

          {/* ÁôªÂΩïË°®Âçï */}
          <Form
            form={form}
            name="admin-login"
            onFinish={handleSubmit}
            autoComplete="off"
            size="large"
          >
            <Form.Item
              name="password"
              rules={[
                { required: true, message: 'ËØ∑ËæìÂÖ•ÁÆ°ÁêÜÂëòÂè£‰ª§' },
                { min: 6, message: 'Âè£‰ª§ÈïøÂ∫¶Ëá≥Â∞ë6‰Ωç' }
              ]}
            >
              <Input.Password
                prefix={<LockOutlined />}
                placeholder="ËØ∑ËæìÂÖ•ÁÆ°ÁêÜÂëòÂè£‰ª§"
                autoComplete="current-password"
              />
            </Form.Item>

            <Form.Item style={{ marginBottom: 0 }}>
              <Button
                type="primary"
                htmlType="submit"
                loading={loading}
                block
                style={{ height: '44px' }}
              >
                {loading ? 'ÁôªÂΩï‰∏≠...' : 'ÁôªÂΩï'}
              </Button>
            </Form.Item>
          </Form>

          {/* ÊèêÁ§∫‰ø°ÊÅØ */}
          <div style={{ 
            background: '#f6f8fa', 
            padding: '12px', 
            borderRadius: '8px',
            fontSize: '12px',
            color: '#666'
          }}>
            <Text type="secondary">
              ÊèêÁ§∫ÔºöËØ∑‰ΩøÁî®Ë∂ÖÁ∫ßÁÆ°ÁêÜÂëòÂè£‰ª§ÁôªÂΩïÁ≥ªÁªü
            </Text>
          </div>
        </Space>
      </Card>
    </div>
  );
};

export default Login;
